import { Card } from '@material-ui/core';
import PostItem from './postItem'
import Typography from '@material-ui/core/Typography';


export default function Posts() {

    return(
        <Card elevation={0} style={{ textAlign: 'center', borderRadius: '15' }}>
            <Typography variant="h4" component="h2" style={{ minHeight: '500px', borderBottom: "2px solid rgb(212, 212, 212)", marginTop: '30px'}}>
                Posts
            </Typography>
            <PostItem />
            <PostItem />
            <PostItem />
          </Card>
    )
}
